import React from 'react';
import Layout from './components/layout';
import Profile from './components/profile';

const App = () => {
  return (
    <main>
      <Layout></Layout>
      <Profile />
      <div>Repositories</div>
      <div>Starreds</div>
    </main>
  );
}

export default App;
